DELIMITER $$

--
-- Создать функцию `f_logout_user`
--
CREATE FUNCTION f_logout_user (email varchar(255), pass varchar(255))
RETURNS int(11)
BEGIN

  DECLARE log int;

  SELECT
    COUNT(u.login) INTO log
  FROM users u
  WHERE (u.login LIKE email) & (u.password = pass);

  RETURN log;

  RETURN 1;
END
$$

DELIMITER ;

